import React from 'react';
import Card from './Card';

export default function Discover({ movieslist, heading }) {
    return (
        <div className='discover-display'>
            <div c>{heading}</div>
            <div className='dis-cont'>
            {
                movieslist.map((movie) => (
                    <Card movie={movie} key={movie.id} />
                ))
            }
            </div>
            
        </div>
    )
}
